import React from "react";
// import axios from "axios";

import { Routes, Route } from "react-router-dom";
import { Authorization } from "./pages/index";

function App() {
  return (
    <div className="wrapper">
      <div>Wrapper</div>
      <div className="content">
        <Routes>
        <Route path = '/' element = {<Authorization />} />
      </Routes>
      </div>
    </div>
  );
}

export default App;
